import "./home.cs"
function Home() {
  return (
    <div
      className="home"
      style={{
        backgroundImage: ' url("https://wallpapercave.com/wp/wp5942140.jpg")',
        backgroundSize: "cover",
      }}
    >
      <div className="hero">
        <h3>Hey there</h3>
        <h1>I'm Shabeeb</h1>
      </div>
    </div>
  );
}

export default Home;
